function dynamicColors(qty) {
    var colors = {background:[], border:[]};
    for (i = 0; i < 50; i++) { 
        var r = Math.floor(Math.random() * 255);
        var g = Math.floor(Math.random() * 255);
        var b = Math.floor(Math.random() * 255);
        colors.background.push("rgba(" + r + "," + g + "," + b + ",0.5)");
        colors.border.push("rgba(" + r + "," + g + "," + b + ",0.7)");
    }
    return colors;
}
function getColumn(data, index){
    var initial = data.map(function(item){return item[index];});
    return Array.from(new Set(initial));
}

function selectRowBy(data, criteria, index){
    var filteredData = data.filter(function(item){
        if (item[index] == criteria){
            return item;
        }
    })
    return filteredData;
}

function setAttributes(el, attrs) {
    for(var key in attrs) {
      el.setAttribute(key, attrs[key]);
    }
}

function fillDropdown(id ,title, optionsSet){
    var menu = document.getElementById(id);
    var buttonName = document.createElement("button");
    setAttributes(buttonName,{"class":"btn btn-default dropdown-toggle","type":"button","id":"dropdownMenuButton","data-toggle":"dropdown","aria-expanded":"false"});
    var span = document.createElement("span");
    span.setAttribute('class', 'caret');
    buttonName.innerHTML = title;
    buttonName.appendChild(span);
    var ul = document.createElement("ul");
    setAttributes(ul, {"class":"dropdown-menu","role":"menu","aria-labelledby":"dropdownMenuButton"});
    optionsSet.forEach(element => {
        var li = document.createElement("li");
        li.setAttribute("role","presentation");
        var a = document.createElement("a");
        setAttributes(a, {"class":"alist","role":"menuitem", "tabindex":"-1", "href":"#0"});
        a.innerText = element;
        li.appendChild(a);
        ul.appendChild(li);
    })
    menu.appendChild(buttonName);
    menu.appendChild(ul);
}

